import React,{useState, useEffect} from "react";
import Card from './Card';
import {robots} from './robots';



const CardList=()=>{

	const { allRobots, setRobots}=useState(robots);

	return (

		<div>
			robots.map((ro,i)=>{
				<Card robot={robots[i]} />
			})
		</div>		
	);
}

export default CardList;
